function countDistence (x, y) {
  let x1 = Number(x[0])
  let x2 = Number(x[1])
  let y1 = Number(y[0])
  let y2 = Number(y[1])
  let distenceX = (x1 - y1) * (x1 - y1)
  let distenceY = (x2 - y2) * (x2 - y2)
  return Math.sqrt(distenceX + distenceY)
}
